import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

export default function AdminLogin(){
    const demoEmail = 'abc@gmail.com'
    const demoPassword = 'abc'
    const [error, setError] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const navigate = useNavigate();

    const handleVolRegister = (event) => {
        navigate('/volregister')
    }

    const handleAdminRegister = (event) => {
        navigate('/adminregister')
    }

    const handleVolLogin = (event) => {
        navigate('/')
    }

    const handleSubmit = (event) => {
        event.preventDefault();
        if(email === demoEmail && password === demoPassword){
            setError('');
            navigate('/allevents');
        }
        else{
            setError('Invalid email or password')
        }
    }
    return(
        <div style={{textAlign: 'center', display: 'flex', justifyContent: 'center', backgroundColor: '#CCCCFF', height: '100vh'}}>
            <div style={{ border: '1px solid black', padding: '20px', marginTop: '8%', height: '50%', width: '40%', backgroundColor: 'white', color: 'black'}}>
                <h1>Administrator Log In Here</h1>
                <hr />
                <br />
            <form onSubmit={handleSubmit}>
                <label>
                <p>Email <input type="text" onChange={e => setEmail(e.target.value)} /></p>
                </label>
                <label>
                <p>Password <input type="password" onChange={e => setPassword(e.target.value)} /></p>
                </label>
                <br />
                <div>
                <button type="submit" style ={{backgroundColor: '#CCCCFF', boxShadow: '0px 2px 2px lightgray', border: '1px solid black'}}>Submit</button>
                </div>
                {error && <div>{error}</div>}

                <br />
                <div>
                    <button onClick={handleVolRegister} style ={{backgroundColor: '#CCCCFF', display:'inline-block', boxShadow: '0px 2px 2px lightgray', border: '1px solid black'}}>Volunteer Registration</button>
                    <button onClick={handleVolLogin} style ={{backgroundColor: '#CCCCFF', display:'inline-block', boxShadow: '0px 2px 2px lightgray', border: '1px solid black', marginLeft: '2%'}}>Volunteer Login</button>
                    <button onClick={handleAdminRegister} style ={{backgroundColor: '#CCCCFF', display:'inline-block', boxShadow: '0px 2px 2px lightgray', border: '1px solid black', marginLeft: '2%'}}>Admin Registration</button>
                </div>
            </form>


            </div>
        </div>
    );
}
